package vip.wulang.leetcode.problem5461;

import java.util.HashMap;
import java.util.LinkedList;

public class Solution {
    /**
     * 2 == 3
     * 3 == 6
     * 4 == 10
     * 6 == 21
     */
    public int numSub(String s) {
        if (s == null || s.length() == 0) {
            return 0;
        }

        int sum = 0;
        int start = -1;
        HashMap<Integer, Integer> map = new HashMap<>(100000 + 1000);
        LinkedList<Info> list = new LinkedList<>();

        for (int i = 0; i < s.toCharArray().length; i++) {
            if (s.charAt(i) == '1' && start == -1) {
                start = i;
            } else if (s.charAt(i) == '0' && start != -1) {
                list.add(new Info(start, i - 1));
                start = -1;
            }
        }

        if (start != -1 && s.charAt(s.length() - 1) == '1') {
            list.add(new Info(start, s.length() - 1));
        }


        for (Info info : list) {
            sum += currentMax(map, info.start, info.end);
        }

        return sum;
    }

    private static class Info {
        int start;
        int end;

        public Info(int start, int end) {
            this.start = start;
            this.end = end;
        }
    }

    private int currentMax(HashMap<Integer, Integer> map, int startIndex, int endIndex) {
        if (endIndex < startIndex) {
            return 0;
        }
        if (endIndex == startIndex) {
            return 1;
        }
        map.put(1, 1);
        int sum = 0;
        int current = endIndex - startIndex + 1;

        Integer integer = map.get(current);
        if (integer != null) {
            return integer;
        }

        for (int i = map.size() + 1; i <= current; i++) {
            map.put(i, i + map.get(i - 1));
        }

        return map.get(current);
    }

    public static void main(String[] args) {
        System.out.println(
                new Solution().numSub(
                        ""
                )
        );
        
    }
}